DROP VIEW IF EXISTS `results_view`;
CREATE VIEW `results_view` AS 
  select `v`.`variable_name` AS `variable_name`,`d`.`NAME` AS `Name`,`d`.`ENDPOINT` AS `endpoint`,`r`.`FREQUENCY` AS `frequency` from ((`l2s`.`variables` `v` join `l2s`.`dataset` `d`) join `l2s`.`result` `r`) where ((`r`.`var_key` = `v`.`ID`) and (`r`.`dataset_key` = `d`.`ID`) and (`r`.`ISLIKE` = 0));
